import Login from '../Pages/Login';
// import Dashboard from '../Pages/Dashboard';

const routes = [
	{
		path: '/login',
		component: Login,
		isPrivate: false,
	},
	{
		path: '/*',
		component: NotFound,
		isPrivate: true,
	}
];

export default routes;
